function ThemeStyle(props) {

	let theme = (props.mode === 'Dark') ? 'darkmode' : 'lightmode';

	return(console.log({
		background: (theme === 'darkmode') ? 'darkgray' : 'lightgray',
	}));
}

export default ThemeStyle;
